  boards: Array<JSX.Element>;
}

class App extends React.Component<{}, AppState> {
  render () {
    return (
      <div className="app">
        <Sidebar /> 
        <Board 
          boardName="Board 1"
          boardDueDate="01-10-2019"
        />
      </div>
    );
  }
}

export default App;
